"use strict";function AddRow(n,t){$.ajax({async:!1,data:{entryDay:t,projectID:0,activityID:0},url:"/Home/AddHourWorked"}).success(function(t){var i="#hoursworkedrow"+n.id.slice(-3);console.log(i);$(i).append(t)})}function disableDiv(){$("#EditHoursWorked :input").attr("readonly","readonly")}function CopyHours(){var n=new Date($("#currentWeekEndDate").val());console.log("Current Week ISO: "+n);$.ajax({contentType:"application/json",type:"POST",data:JSON.stringify({currentWeek:n}),url:"/Home/GetLastWeek",dataType:"json"}).success(function(n){var i,t;for(console.log("Success"),console.log(n),i=0;i<n.length;i++)t=new Array(7),t[0]="Sun",t[1]="Mon",t[2]="Tue",t[3]="Wed",t[4]="Thu",t[5]="Fri",t[6]="Sat",$.ajax({async:!1,data:{entryDay:n[i].currentDay,projectID:n[i].Project_projectID,activityID:n[i].Activity_activityID},url:"/Home/AddLastWeekPartials"}).success(function(r){var u="#hoursworkedrow"+t[n[i].currentDay];$(u).prepend(r)})}).error(function(){console.log("Failed")})}$(document).ready(function(){var n=$("#totalHoursStart").html();$("#totalHours").text(n+" Total Hours");$(".hoursInput").change(function(){var n=0;$(".hoursInput").each(function(){n+=parseInt($(this).val())||0});$("#totalHours").text(n+" Total Hours")})});